description:
100 Per Cent: Planes

Technology Documentary hosted by Jason Done, published by National Geographic in 2012 - English narration


Information
------------------------------

100 Per Cent: Planes
100 Percent features amazing stories of aviation and flying. From military planes to recreational planes to stunt planes, we fly high and learn more about the world's 400,000+ aircraft from the pilots and engineers that work closely with them. Discover the most versatile military plane that can dogfight and bomb in a single mission. Take an aerobatic stunt lesson with a 25-year veteran pilot. And tour a luxurious private jet, rumoured to cost up to half a billion dollars.

